const Content = (props) => {

    const {title ,data } = props;
    if(typeof data == 'undefined')
        return null;


    return(
        <React.Fragment>

<Container>
  <Row>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" rounded />
    </Col>
    </Row>
    </Container>


       
        </React.Fragment>
    );
};

export default Content ;
